import React, { useEffect, useState } from "react";
import { Container } from "react-bootstrap";
import PageTransition from "../PageTransition";
import SearchBar from "../components/SearchBar";
import { Link } from "react-router-dom";

export default function Videos() {
  const [videos, setVideos] = useState([]);
  const [query, setQuery] = useState("");
  const [loading, setLoading] = useState(true);

  const formatDate = (date) =>
    new Date(date).toLocaleDateString("en-IN", {
      year: "numeric",
      month: "long",
      day: "numeric",
    });

  // âœ… FETCH FROM BACKEND (MongoDB)
  useEffect(() => {
    setLoading(true);

    fetch(`${process.env.REACT_APP_API_URL}/api/videos`)
      .then((res) => res.json())
      .then((data) => {
        setVideos(data || []);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Failed to fetch videos", err);
        setLoading(false);
      });
  }, []);

  // âœ… SEARCH BY TITLE (MongoDB field)
  const filtered = videos.filter((v) =>
    v.title.toLowerCase().includes(query.toLowerCase())
  );

  return (
    <PageTransition>
      <Container>
        <div className="page-header">
          <h1>Videos</h1>

          <div className="page-search">
            <SearchBar
              value={query}
              onChange={setQuery}
              placeholder="Search videos..."
            />
          </div>
        </div>

        {/* Loading skeleton */}
        {loading && (
          <div className="video-grid">
            {[...Array(6)].map((_, i) => (
              <div key={i} className="video-card skeleton">
                <div className="video-wrapper shimmer-box" />
                <div className="video-title shimmer-line" />
              </div>
            ))}
          </div>
        )}

        {!loading && filtered.length === 0 && (
          <div className="no-results">ðŸ˜• No results found</div>
        )}

        {!loading && filtered.length > 0 && (
          <div className="video-grid">
            {filtered.map((v) => (
              <article key={v._id} className="video-card">
                {/* CLICK â†’ Watch page */}
                <Link
                  to={`/videos/${v.videoId}`}
                  className="video-wrapper-link"
                  state={{
                    title: v.title,
                    author: v.author,
                    date: formatDate(v.date),
                    embed: v.embed,
                  }}
                >
                  <div
                    className="video-wrapper"
                    onMouseEnter={(e) => {
                      const iframe =
                        e.currentTarget.querySelector("iframe");
                      iframe.src = v.embed + "?autoplay=1&mute=1";
                    }}
                    onMouseLeave={(e) => {
                      const iframe =
                        e.currentTarget.querySelector("iframe");
                      iframe.src = v.embed;
                    }}
                  >
                    <iframe
                      src={v.embed}
                      title={v.title}
                      loading="lazy"
                      allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
                      allowFullScreen
                      style={{ pointerEvents: "none" }}
                    />
                  </div>
                </Link>

                <h2 className="video-title">
                  <Link
                    to={`/videos/${v.videoId}`}
                    state={{
                      title: v.title,
                      author: v.author,
                      date: formatDate(v.date),
                      embed: v.embed,
                    }}
                    style={{ color: "white", textDecoration: "none" }}
                  >
                    {v.title}
                  </Link>
                </h2>

                <div className="video-meta">
                  <span>{v.author}</span>
                  <span>â€”</span>
                  <span>{formatDate(v.date)}</span>
                </div>
              </article>
            ))}
          </div>
        )}
      </Container>
    </PageTransition>
  );
}
